import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with domcontentloaded to avoid timeout
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for critical elements to ensure page is loaded
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.waitForSelector('.category-card', { timeout: 5000 });

    // Extract product data from the page
    const extractedData = await page.evaluate(() => {
      const data = {
        products: [],
        categories: [],
        userData: {}
      };

      // Extract product information
      document.querySelectorAll('.product-card').forEach(card => {
        const title = card.querySelector('.product-title')?.textContent || '';
        const price = card.querySelector('.product-price')?.textContent || '';
        const rating = card.querySelector('.stars')?.textContent || '';
        data.products.push({ title, price, rating });
      });

      // Extract category information
      document.querySelectorAll('.category-card').forEach(card => {
        const category = card.querySelector('h3')?.textContent || '';
        data.categories.push(category);
      });

      // Extract user-related data
      const userLinks = [];
      document.querySelectorAll('a').forEach(link => {
        if (link.textContent.includes('Your')) {
          userLinks.push(link.textContent.trim());
        }
      });
      data.userData.links = userLinks;

      return data;
    });

    // Take screenshot after data extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    // Simulate browsing through categories
    const categories = await page.$$eval('.category-card', cards => 
      cards.map(card => card.textContent.trim())
    );

    for (let i = 0; i < Math.min(3, categories.length); i++) {
      await page.click(`.category-card:nth-child(${i + 1})`);
      await page.waitForTimeout(1000);
      await page.screenshot({ 
        path: path.join(screenshotsDir, `step_3_category_${i + 1}.png`) 
      });
      screenshots.push(path.join(screenshotsDir, `step_3_category_${i + 1}.png`));
      await page.goBack();
    }

    return {
      success: true,
      action: "Extracted product data, categories, and user links from Amazon simulation",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete bulk data extraction",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
